import React, { useState } from "react";
import "./Login_Registrarse.css";
import icono_usuario from "../Login_imagenes/iconos/usuario.png";
import icono_key from "../Login_imagenes/iconos/contrasena.png";
import icono_email from "../Login_imagenes/iconos/email.png";

const Registrarse = ({ setView }) => {
  const [userData, setUserData] = useState({
    username: "",
    email: "",
    password: "",
    confirmPassword: "",
  });
  const [errors, setErrors] = useState({});
  const [attemptedSubmit, setAttemptedSubmit] = useState(false);

  const handleChange = (event) => {
    const { name, value } = event.target;
    setUserData({
      ...userData,
      [name]: value,
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    const validationErrors = validateForm(userData);
    setErrors(validationErrors);
    setAttemptedSubmit(true);

    if (Object.keys(validationErrors).length === 0) {
      console.log("Datos del formulario:", userData);
      // lógica para enviar los datos del formulario al servidor
    }
  };

  const validateForm = (data) => {
    let errors = {};

    if (!data.username.trim()) {
      errors.username = "El nombre de usuario es requerido";
    } else if (data.username.trim().length < 4 || data.username.trim().length > 20) {
      errors.username = "El nombre de usuario debe tener entre 4 y 20 caracteres";
    }

    if (!data.email.trim()) {
      errors.email = "El correo electrónico es requerido";
    } else if (!/\S+@\S+\.\S+/.test(data.email)) {
      errors.email = "El correo electrónico ingresado no es válido";
    }

    if (!data.password.trim()) {
      errors.password = "La contraseña es requerida";
    } else if (data.password.trim().length < 5 || data.password.trim().length > 20) {
      errors.password = "La contraseña debe tener entre 5 y 20 caracteres";
    } else if (!/^[A-Za-z0-9]+$/.test(data.password)) {
      errors.password = "La contraseña debe contener solo letras y números";
    }

    if (data.password !== data.confirmPassword) {
      errors.confirmPassword = "Las contraseñas no coinciden";
    }

    return errors;
  };

  return (
    <div className="bodyregister">
      <form className="formRegister" onSubmit={handleSubmit}>
        <h2>Registrarse</h2>
        <div className="formGroup">
          <label htmlFor="username">Nombre de usuario</label>
          <input
            type="text"
            id="username"
            name="username"
            value={userData.username}
            onChange={handleChange}
          />
          {attemptedSubmit && errors.username && (
            <span className="errorMessage">{errors.username}</span>
          )}
        </div>
        <div className="formGroup">
          <label htmlFor="email">Correo electrónico</label>
          <input
            type="email"
            id="email"
            name="email"
            value={userData.email}
            onChange={handleChange}
          />
          {attemptedSubmit && errors.email && (
            <span className="errorMessage">{errors.email}</span>
          )}
        </div>
        <div className="formGroup">
          <label htmlFor="password">Contraseña</label>
          <input
            type="password"
            id="password"
            name="password"
            value={userData.password}
            onChange={handleChange}
          />
          {attemptedSubmit && errors.password && (
            <span className="errorMessage">{errors.password}</span>
          )}
        </div>
        <div className="formGroup">
          <label htmlFor="confirmPassword">Confirmar Contraseña</label>
          <input
            type="password"
            id="confirmPassword"
            name="confirmPassword"
            value={userData.confirmPassword}
            onChange={handleChange}
          />
          {attemptedSubmit && errors.confirmPassword && (
            <span className="errorMessage">{errors.confirmPassword}</span>
          )}
        </div>
        <div className="ov-btn-container">
          <div className="ov-btn-grow-box" onClick={handleSubmit}>
            Registrarse
          </div>
        </div>
        <div className="loginLink" onClick={() => setView("login")}>
          ¿Ya tienes una cuenta? Inicia sesión aquí
        </div>
      </form>
    </div>
  );
};

export default Registrarse;
